import './Trip.css';

export default function Trip() {
  return (
    <div className="trip">
      <div className="trip__goal-chart"></div>
      <div className="trip__text">
        <p className="trip__text__departure-destination">LGW - AMS</p>
        <p className="trip__text__status">Pending</p>
        <p className="trip__text__date">26 Nov. 2022</p>
      </div>
    </div>
  )
}
